package at.favre.tools.dice.encode;

import at.favre.tools.dice.encode.byteencoder.AByteEncoder;
import org.apache.commons.codec.binary.Base64;
import org.junit.Test;

import java.io.ByteArrayOutputStream;
import java.nio.charset.StandardCharsets;
import java.util.Random;
import java.util.zip.GZIPOutputStream;

public class CompressionTest {

    @Test
    public void testRandomData() throws Exception {
        testAllByteEncoder(gen(1024));
        testAllByteEncoder(gen(1024 * 128));
    }

    @Test
    public void testImage1() throws Exception {
        testAllByteEncoder(TEST_IMAGE_BASE64);
    }

    private void testAllByteEncoder(byte[] data) throws Exception {
        byte[] compressedOriginal = compress(data);
        System.out.println("Original size: \t\t\t" + data.length + " byte");
        System.out.println("Compressed size (org): \t" + compressedOriginal.length + " byte");
        System.out.println("\n=======================================");

        EncoderHandler handler = new EncoderHandler();
        handler.load().forEach(encoder -> {
            if (encoder instanceof AByteEncoder) {
                testCompression(data, encoder);
            }
        });
    }

    private void testCompression(byte[] raw, Encoder encoder) {
        try {
            String encoded = encoder.encode(raw);
            byte[] compressedEncoded = compress(encoded.getBytes(StandardCharsets.UTF_8));
            System.out.println("\n[" + encoder.names()[0] + "]");
            System.out.println("Encoded size: \t\t\t" + encoded.getBytes(StandardCharsets.UTF_8).length + " byte (" + differencePercent(raw.length, encoded.getBytes(StandardCharsets.UTF_8).length) + ")");
            System.out.println("Compressed size (enc): \t" + compressedEncoded.length + " byte (" + differencePercent(compress(raw).length, compressedEncoded.length) + ")");
        } catch (Exception e) {
            throw new IllegalStateException(e);
        }
    }

    private String differencePercent(int originalLength, int differentLength) {
        int byteDiff = differentLength - originalLength;
        int percent = (byteDiff * 100) / differentLength;
        return byteDiff + " byte [+" + percent + "%]";
    }


    public static byte[] compress(byte[] data) throws Exception {
        GZIPOutputStream gzipOutputStream = null;
        try (ByteArrayOutputStream bos = new ByteArrayOutputStream(data.length)) {
            gzipOutputStream = new GZIPOutputStream(bos);
            gzipOutputStream.write(data);
            gzipOutputStream.close();
            return bos.toByteArray();
        }
    }

    private static byte[] gen(int length) {
        byte[] temp = new byte[length];
        new Random().nextBytes(temp);
        return temp;
    }

    private static final byte[] TEST_IMAGE_BASE64 = Base64.decodeBase64(
            ""
    );
}
